// src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import RequestRide from './pages/RequestRide';
import RideOptions from './pages/RideOptions';
import TravelHistoryPage from './pages/TravelHistoryPage';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={RequestRide} />
        <Route path="/ride-options" exact component={RideOptions} />
        <Route path="/travel-history" exact component={TravelHistoryPage} />
      </Switch>
    </Router>
  );
};

export default App;
